【ブルボン ミニビットアソートの詳細】<br>
ミルクチョコ、アーモンドチョコ、ウエハースチョコ、ストロベリーチョコに新しくムギパフパフチョコが加わりました。５種類の味をお楽しみください。<br><br>

【原材料】<br>
●ミルク：砂糖、全粉乳、カカオマス、植物油脂、ココアバター、乳糖、バターオイル、乳化剤(大豆由来)、香料<br>
●アーモンド：砂糖、全粉乳、カカオマス、アーモンド、植物油脂、ココアバター、乳化剤(大豆由来)、香料<br>
●ウエハース：砂糖、全粉乳、ｶｶｵﾏｽ、植物油脂、ココアバター、小麦粉、ショートニング、還元水飴、ココアパウダー、でん粉、マルトース、マーガリン、ドライイースト、食塩、、乳化剤(大豆由来)、着色料(カラメル)、香料(乳由来)、膨脹剤、ビタミンC<br>
●ストロベリー：砂糖、全粉乳、カカオマス、ココアバター、植物油脂、乳糖、脱脂粉乳、いちごパウダー、トレハロース、、乳化剤(大豆由来)、香料、着色料(ビートレッド)、酸味料<br>
●ムギパフ：砂糖、全粉乳、カカオマス、植物油脂、ココアバター、小麦パフ、乳糖、バターオイル、乳化剤(大豆由来)、香料、膨脹剤<br><br>

【本製品に含まれるアレルギー物質】<br>
小麦 乳 大豆<br><br>

【栄養成分表示】<br>
●ミルク：1個 (標準9.2ｇ) 当り<br>
エネルギー：54kcal、たんぱく質：0.7g、脂質：3.5g、炭水化物：4.8g、ナトリウム：5.7mg、食塩相当量：0.01g<br>
●アーモンド：1個 (標準9.0ｇ) 当り<br>
エネルギー：52kcal、たんぱく質：0.8g、脂質：3.4g、炭水化物：4.6g、ナトリウム：5.4mg、食塩相当量：0.01g<br>
●ウエハース：1個 (標準7.4ｇ) 当り<br>
エネルギー：41kcal、たんぱく質：0.6g、脂質：2.5g、炭水化物：4.1g、ナトリウム：4.9mg、食塩相当量：0.01g<br>
●ストロベリー：1個 (標準9.2ｇ) 当り<br>
エネルギー：54kcal、たんぱく質：0.6g、脂質：3.6g、炭水化物：4.7g、ナトリウム：6.1mg、食塩相当量：0.02g<br>
●ムギパフ：1個 (標準8.1ｇ) 当り<br>
エネルギー：46kcal、たんぱく質：0.6g、脂質：2.9g、炭水化物：4.3g、ナトリウム：5.5mg、食塩相当量：0.01g<br><br>

